import React from 'react';
import { UserItem } from './UserItem.component';

export const UserList = ({ github, loading }) => {
  return (
    <div style={userStyle}>
      {github.map(gitUsers => {
        return <UserItem key={gitUsers.id} users={gitUsers} />;
      })}
    </div>
  );
};

const userStyle = {
  display: 'grid',
  gridTemplateColumns: 'repeat(3, 1fr)',
  gridGap: '1rem'
};
